import React from 'react';
import './CheckList.scss';
import CheckListItem from './CheckListItem';

interface ICheckListProps {

}

const CheckList : React.FC<ICheckListProps> = props => {
    return (
        <section className={`before-check-list`}>
            <h2>Before departure</h2>
            <CheckListItem title='France Diplomatie' text='' link='https://www.diplomatie.gouv.fr/fr/conseils-aux-voyageurs/conseils-par-pays-destination/grece/'/>
            <CheckListItem title='Covid' text='Vaccination certificate (14 days have elapsed since the last vaccination)'/>
            <CheckListItem title='Passenger Locator Form (PLF)' text='To be filled online no later than 23:59 (11.59 PM) of the day before arriving in Greece' link='https://travel.gov.gr/#/'/>
            <CheckListItem title='Flight' text='Online check-in opens 30 hours before departure' link='https://www.transavia.com/en-EU/my-transavia/check-in/login/'/>
            <CheckListItem title='Accommodation' text='Airbnb booked'/>
            <CheckListItem title='Currency' text='Euro'/>
            <CheckListItem title='Visa' text='No need for EU'/>
            <CheckListItem title='Electricity' text='Same as France'/>
            <CheckListItem title='From airport to city center' text='Metro 3 (blue line) to Syntagma (Σύνταγμα) station, 50 min, every 30 min (05′ and 35′), 10€ 
                OR bus X95 (between exits 4 and 5 of arrivals terminal) to Syntagma (Σύνταγμα) station, 40-55 min, every 15-20 min (timetable : https://www.athensairportbus.com/en/timetable/x95airporttoathensdowntown.html - 19:40, 19:55, 20:10, 20:25, 20:40, 20:55), 6€
                The airport is 35 km away from the city center.'/>
        </section>
    );
}

export default CheckList;
